import React from "react";
import ApexChart from "./PieChart";
import "./MainPage.css";

function MainPage() {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col-md">
            <div id="chart">
              <ApexChart />
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default MainPage;
